import React, { Component } from "react";
import { Link } from "react-router-dom";
export default class Header extends Component {
    render() {
        return(
            <header>
                <ul>
                    <li className="logoHeader"></li>
                    <a href="/"><li id="h_li">Home</li> </a>
                    <li>About</li> 
                    <li>Contact</li>
                </ul>
                <br />
                <hr id="bar_header"/>
            </header>
        )
    }
}
